import { HttpClient } from '@angular/common/http';
import { Component, OnInit } from '@angular/core';
import { ActivatedRoute, Router } from '@angular/router';
import { PermissionService } from '../../../Services/permission.service';
import { FonctionService } from '../../../Services/fonction.service';
import { ApplicationService } from '../../../Services/application.service';
import { Permission } from '../../../Models/permission.model';
import { Fonction } from '../../../Models/fonction.model';
import { Application } from '../../../Models/application.model';

@Component({
  selector: 'app-ModifierPermission',
  templateUrl: './ModifierPermission.component.html'
})
export class ModifierPermissionComponent implements OnInit {
  public permission: any;
  public fonction: Fonction = new Fonction();
  public application: Application = new Application();
  oldPermission: string | null = "";
  errorMessage: string = '';
  showError: boolean = false;
  constructor(private PermissionService: PermissionService, private FonctionService: FonctionService, private ApplicationService: ApplicationService, private router: Router, private route: ActivatedRoute){}

  ngOnInit(): void {
    const idParam = this.route.snapshot.paramMap.get('id');
    if (idParam) {
      const id = +idParam;
      if (!isNaN(id)) {
        this.PermissionService.getMultiFonction(id).subscribe((data) => {
          if (data) {
            this.permission = data;
            this.oldPermission = this.permission.nom;
            this.FonctionService.getFonction(this.permission.idFonction).subscribe((data) => {
              if (data) { this.fonction = data; }
              this.ApplicationService.getApplication(this.fonction.idApplication).subscribe((data) => { if (data) { this.application = data;  } });
            });
          }
          else {
            this.PermissionService.getFonctionUnique(id).subscribe((data) => {
              if (data) {
                this.permission = data;
                this.oldPermission = this.permission.nom;
                this.FonctionService.getFonction(this.permission.idFonction).subscribe((data) => {
                  if (data) { this.fonction = data; }
                  this.ApplicationService.getApplication(this.fonction.idApplication).subscribe((data) => { if (data) { this.application = data; } });
                });
              }
            });
          }
        });
      }
      else { console.error('La valeur du paramètre "id" n\'est pas un nombre valide.'); }
    }
    else { console.error('Le paramètre "id" est manquant dans l\'URL.'); }
  }


  onSubmit() {
    this.PermissionService.RechFonctionUnique(this.permission.nom, this.application.id, this.permission.idRole).subscribe((PermUniqueList) => {
      this.PermissionService.RechMultiFonction(this.permission.nom, this.application.id, this.permission.idRole).subscribe((PermMultiList) => {
        if (PermUniqueList.length != 0 && this.oldPermission || PermMultiList.length != 0 && this.permission.nom != this.oldPermission) {
          this.errorMessage = "Une permission avec ce nom existe déjà avec ce role !";
          this.showError = true;
        }
        else {
          this.PermissionService.updatePermission(this.permission).subscribe((response) => {
            if (response) { console.log(this.permission); this.router.navigate(['/Permission']); }
          });
        }
      });
    });
  }






}


<div class="background-titre"> <h1> GESTION DES PERMISSIONS </h1> </div>


<div class="ajouter-content">

  <div class="ajouter-entete">
    <div class="modifier-return" [routerLink]="['/Permission']"> <i class="fa-solid fa-angles-left"></i> RETURN </div>
    <div class="modifier-titre"> MODIFICATION DE LA PERMISSION </div>
  </div>


  <form (ngSubmit)="onSubmit()" class="yellow-border">
    <div class="form-content">

      <div style="transform:translateX(42px); margin-left:70px;" *ngIf="showError" class="alert alert-danger" role="alert"> {{errorMessage}}</div>

      <div class="form-content-rows">
        <label for="nomApp">APPLICATION :</label>
        <input class="yellow-border" type="text" id="nomApp" name="nomApp" [(ngModel)]="application.nom" style="cursor:not-allowed" readonly>
      </div>

      <div class="form-content-rows">
        <label for="type">FONCTION :</label>
        <input class="yellow-border" type="text" id="nomFonc" name="nomFonc" [(ngModel)]="fonction.type" style="cursor:not-allowed" readonly>
      </div>


      <div class="form-content-rows">
        <label for="nom">NOM :</label>
        <input class="yellow-border" type="text" id="nom" name="nom" [(ngModel)]="permission.nom" required>
      </div>


      <div class="form-content-rows">
        <label class="no-select"></label> <div> <button type="submit" class="valider">VALIDER</button> </div>
      </div>


    </div>
  </form>


</div>
